import React from 'react';


class GameDetail extends React.Component {
    constructor(props) {
        super(props);

    }   

    componentDidMount() {
        this.props.fetchGames()
        .then(_ => this.props.allGames)
    }

    render () {
        return (<div>Holi</div>)
    }

}

export default GameDetail
